        return (
            <section className="section">
                      <Route exact path="/arrivals" component={NewArrivals}/>

                <Carousel/>
                <SideBar/>
                <Quote />
                <BookCards />
                <CompanyCard/>
                <Quote/>
                <ShopBy/>
              </section>

        )
    }
}

export default Sections;
